import { Component } from 'react';
import Header from './conponents/Header/Header.jsx';
import Nav from './conponents/Nav/Nav.jsx';
import Profile from './conponents/Profile/Profile.jsx';
import Dialog from './conponents/Dialogs/Dialog.jsx';
import New from './conponents/New/New.jsx';
import Setting from './conponents/Setting/Setting.jsx';
import Music from './conponents/Music/Music.jsx';
// import Hi from './Hi';
// import Hak from './image/download.jpg';
import './App.css';
import { Route, Redirect } from 'react-router-dom';

export default class App extends Component {
  // state = {
  //   name: 'barlus',
  //   imgPerson: [{ img: Hak }],
  // };
  render() {
    return (
      <div className='App'>
        <Header />
        <Nav />
        <Route exact path='/dialog' component={Dialog} />
        {/* <Route
          path={'/dialog/:name'}
          component={(props) => (
            <Hi {...props} imgP={this.state.imgPerson} />
          )}
        /> */}
        <Redirect to={'/dialog'} />
        <Route path='/profile' component={Profile} />
        <Route path='/new' component={New} />
        <Route path='/setting' component={Setting} />
        <Route path='/music' component={Music} />
      </div>
    );
  }
}
